window.bookSummaryJSON = "<p>The truth about Mara Dyer’s dangerous and mysterious abilities continues to unravel in the <i>New York Times</i> best-selling sequel to the thrilling <i>The Unbecoming of Mara Dyer</i>.</p> <p>Mara Dyer once believed she could run from her past. She can’t. She used to think her problems were all in her head. They aren’t. She couldn’t imagine that after everything she’s been through, the boy she loves would still be keeping secrets. She’s wrong.</p> <p>In this gripping sequel to <i>The Unbecoming of Mara Dyer</i>, the truth evolves and choices prove deadly. What will become of Mara Dyer next?</p>"; 
